(function() {
    function setCookie(name, value, days) {
      var expires = '';
      if (days) {
        var date = new Date();
        date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
        expires = '; expires=' + date.toUTCString();
      }
      document.cookie = name + '=' + (value || '') + expires + '; path=/';
    }

    function getCookie(name) {
      var nameEQ = name + '=';
      var ca = document.cookie.split(';');
      for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) === ' ') c = c.substring(1, c.length);
        if (c.indexOf(nameEQ) === 0) return c.substring(nameEQ.length, c.length);
      }
      return null;
    }

    var pageViews = parseInt(getCookie('page_views')) || 0;
    setCookie('page_views', ++pageViews, 1);

    window.dataLayer.push({
      'event': 'page_visit_counter',
      'page_visit_count': pageViews
    });
  })();

// Funktion för att initiera eller hämta tidsstämpeln
    function getOrInitializeTimestamp() {
        try {
            let startTime = sessionStorage.getItem('startTime');
            if (!startTime) {
                startTime = Date.now();
                sessionStorage.setItem('startTime', startTime.toString());
            }
            return parseInt(startTime, 10);
        } catch (e) {
              //console.error('Fel vid hantering av sessionStorage:', e);
                _mtm.push({'event': 'sessionStorageNotAvalible'});
            // Hantera fallet när sessionStorage inte är tillgängligt
            // Du kan välja att returnera ett standardvärde eller hantera det på annat sätt
            return Date.now(); // Ett exempel på hantering
        }
    }

    // Heartbeat funktion
    function heartbeat(intervalId) {
        try {
            const startTime = getOrInitializeTimestamp();
            const currentTime = Date.now();
            const elapsedTimeInSeconds = Math.floor((currentTime - startTime) / 1000);

            // Skicka ditt event här med elapsedTimeInSeconds
            if (elapsedTimeInSeconds >= 15) {
                _mtm.push({'event': 'sessionTimeReached'});
                clearInterval(intervalId); // Stoppa intervallet
                return; // Avsluta funktionen
            }

            // Uppdatera värdet i sessionStorage
            sessionStorage.setItem('elapsedTime', elapsedTimeInSeconds.toString());
        } catch (e) {
            console.error('Fel vid hantering av heartbeat:', e);
            // Hantera fel som kan uppstå under heartbeat-processen
        }
    }

    // Funktion för att starta heartbeat-processen
    function startHeartbeat(interval = 1000) { // Standardintervall är 1000ms (1 sekund)
        const intervalId = setInterval(() => heartbeat(intervalId), interval);
    }

    // Starta heartbeat-funktionen
    startHeartbeat();